import axios from 'axios';
import { apiBaseUrl } from '../contants/constants';

const token = localStorage.getItem('admin_token');
const headerData = { Authorization: `Bearer ${token}` };
const addCourseApi = async (data) => {
  console.log(data, 'datata');
  try {
    const result = await axios.post(`${apiBaseUrl}/admin/course/create`, data, {
      headers: headerData,
    });
    if (result) {
      return result;
    }
  } catch (err) {
    return { data: err.response.data };
  }
};
const getCourseApi = async () => {
  try {
    const result = await axios.get(`${apiBaseUrl}/admin/course/getAll`, {
      headers: headerData,
    });
    if (result) {
      return result;
    }
  } catch (err) {
    return { data: err.response.data };
  }
};
const getEditCourseApi = async (id, data) => {
  try {
    const result = await axios.put(
      `${apiBaseUrl}/admin/course/edit/${id}`,
      data,
      {
        headers: headerData,
      }
    );
    if (result) {
      return result;
    }
  } catch (err) {
    return { data: err.response.data };
  }
};
const deleteCourseApi = async (id) => {
  try {
    const result = await axios.delete(
      `${apiBaseUrl}/admin/course/removeById/${id}`,

      {
        headers: headerData,
      }
    );
    if (result) {
      return result;
    }
  } catch (err) {
    // return { data: err.response.data };
  }
};
getUser = async (pageNo, limit) => {
  try {
    const response = await axios.get(
      `${apiBaseUrl}/frontend/user/get/${pageNo}/${limit}`,
      { headers: headerData }
    );
    if (response.status == 200) {
      return response.data;
    } else {
      throw new Error(response.message);
    }
  } catch (err) {
    return {
      data: '',
      response: err.message,
      status: 400,
    };
  }
};

export { addCourseApi, getCourseApi, getEditCourseApi, deleteCourseApi };
